// ---  () ---
const SHEET_ID = '1AswMz2eWfso3cjC4mmvVkaufamcSYmZxpLRyQ1e_uF8'; 
const DATA_SHEET_NAME = 'UserData'; //  UserData

function doPost(e) {
  const lock = LockService.getScriptLock();
  lock.tryLock(10000);
  try {
    const params = JSON.parse(e.postData.contents);
    const action = params.action;
    const userId = params.userId; // 
    
    // 
    if (!userId) return ContentService.createTextOutput(JSON.stringify({status: 'error', message: 'No User ID'}));

    const ss = SpreadsheetApp.openById(SHEET_ID);
    let sheet = ss.getSheetByName(DATA_SHEET_NAME);
    if (!sheet) {
      sheet = ss.insertSheet(DATA_SHEET_NAME);
      // 
      sheet.appendRow(['UserID', 'Data', 'LastUpdated']);
    }

    if (action === 'save_collection') {
      const dataStr = JSON.stringify(params.data);
      const timestamp = new Date();
      
      //  UserID 
      const textFinder = sheet.getRange(1, 1, sheet.getLastRow(), 1).createTextFinder(userId).matchEntireCell(true);
      const result = textFinder.findNext();

      if (result) {
        //  (Row, Column 2 = Data, Column 3 = Time)
        const row = result.getRow();
        sheet.getRange(row, 2).setValue(dataStr);
        sheet.getRange(row, 3).setValue(timestamp);
      } else {
        // 
        sheet.appendRow([userId, dataStr, timestamp]);
      }
      
      return ContentService.createTextOutput(JSON.stringify({status: 'success'}));
    }
  } catch (e) {
    return ContentService.createTextOutput(JSON.stringify({status: 'error', error: e.toString()}));
  } finally {
    lock.releaseLock();
  }
}

function doGet(e) {
  const action = e.parameter.action;
  const userId = e.parameter.userId; // 

  if (action === 'load_collection' && userId) {
    const ss = SpreadsheetApp.openById(SHEET_ID);
    const sheet = ss.getSheetByName(DATA_SHEET_NAME);
    if (!sheet) return ContentService.createTextOutput(JSON.stringify({}));

    //  UserID
    const textFinder = sheet.getRange(1, 1, sheet.getLastRow(), 1).createTextFinder(userId).matchEntireCell(true);
    const result = textFinder.findNext();

    if (result) {
      //  Column 2
      const data = sheet.getRange(result.getRow(), 2).getValue();
      return ContentService.createTextOutput(data).setMimeType(ContentService.MimeType.JSON);
    } else {
      // 
      return ContentService.createTextOutput(JSON.stringify({})).setMimeType(ContentService.MimeType.JSON);
    }
  }
  return ContentService.createTextOutput(JSON.stringify({error: 'Invalid request'}));
}
